import logo from './logo.svg';
import './App.css';
import { Button, Input } from '@mui/material';
import { Spacing, Stack } from '@mui/system';

function App() {
  return (
    <div className="App">
      <Stack spacing={1}>
        <div>
      <Button variant="contained" sx={{ m: 8 }}>Add</Button>
      <Button variant="contained">Sample 10</Button>
      </div>
      <Input placeholder='Write the number you want to add here'>
        </Input>
      </Stack>
    </div>
  );
}

export default App;
